import React from 'react';
import './profile.css';
import Monitor from '../Monitor/Monitor';
import Title from '../Title';

function profile() {
    return (
        <div>
            <div className='hero-container'>
                <Title title="Profile" />
                <Monitor />
            </div>
        </div>
    )
}

export default profile
